def get_by_lat_long(lat: str, lng: str) -> list:
    """
    Get the city by latitude and longitude.
    :param lat: Latitude
    :param lng: Longitude
    :return: City
    :rtype: list
    :author = Muhammad Umer Farooq
    :since v1.0.0
    """
    return [x for x in cities if x['lat'] == lat and x['lng'] == lng]
